export const REQUEST_MEMBER_DATA = "REQUEST_MEMBER_DATA";
export const RECEIVE_MEMBER_DATA = "RECEIVE_MEMBER_DATA";
export const TOGGLE_MEMBER_SIGN_IN = "TOGGLE_MEMBER_SIGN_IN";


export const requestMemberData = (memberID) => ({ 
    type: REQUEST_MEMBER_DATA, memberID
});

export const receiveMemberData = (memberData) => ({
     type: RECEIVE_MEMBER_DATA, memberData 
});

export const toggleMemberSignin = () => ({
    type: TOGGLE_MEMBER_SIGN_IN
});
